import React from 'react'

const DietResults = ({food}) => {
    const foodList = food.map(meal => {
        return (
            <div>
                <h3>{meal.name}</h3>
                <img src={`https://spoonacular.com/recipeImages/${meal.id}-480x360.jpg`} alt={food.name} />
            </div>
        )
    })
    
}

export default DietResults
